import React from 'react';
import ReactDOM from 'react-dom';

import './assets/css/style.css';

import { BrowserRouter as Router, Link, Route } from 'react-router-dom';
import store from './store/data';
import App from './view/App';
import { Provider } from 'react-redux';
import Dati from './view/Dati';







function Home() {
  return (
    <div>
      <h1>admini首页</h1>
    </div>
  )
}
function Me() {
  return (
    <div>
      <h1>admin个人中心</h1>
    </div>
  )
}
function Product() {
  return (
    <div>
      <h1>admin产品页面</h1>
    </div>
  )
}
class App1 extends React.Component {
  render() {
    return (
      <div id="app">
        <div>所有页面普通内容</div>


        <Router>

          <div className="nav">
            <Link to="/">首页1</Link>
            <Link to="/me">me1</Link>
            <Link to="/product">product1</Link>
          </div>

          {/* exact不加的话为模糊匹配，需要在/下加上 */}
          <Route path="/" exact component={() => (<div>首页1</div>)}></Route>
          <Route path="/me" exact component={() => (<div>me1</div>)}></Route>
          <Route path="/product" exact component={() => (<div>product1</div>)}></Route>
        </Router>

        <Router>
          <div className="nav">
            <Link to="/admin/">Home2</Link>
            <Link to="/admin/product">Product2</Link>
            <Link to="/admin/me">Me2</Link>
          </div>
          <Route path="/admin/" exact component={Home}></Route>
          <Route path="/admin/product" exact component={Product}></Route>
          <Route path="/admin/me" exact component={Me}></Route>
        </Router>
      </div>
    )
  }
}








